import React, {ChangeEvent} from 'react';
import setValue from '../App';

type InputType = {
    addValue: ()=> void
}

const Input = (event: ChangeEvent<HTMLInputElement>) => {
    setValue(event.currentTarget.valueAsNumber)


    return (
        <div>
            <input onChange={Input}/>
        </div>
    );
};

export default Input;
